(2, 1, 'solo planos', 'El león es un mamífero carnívoro de la familia de los félidos y una de las cinco especies del género Panthera. Wikipedia\r\nNombre científico: Panthera leo\r\nEstado de conservación: Vulnerable (Reducción) Enciclopedia de la vida\r\nVelocidad: 80 km/h (Maximum, En periodos muy cortos)\r\nPromedio de vida: 10 – 15 años (Adulto, En libertad), 8 – 10 años (Adulto, En libertad)\r\nMasa Corporal: 190 kg (Adulto), 130 kg (Adulto)\r\nLongitud: 1,8 – 2,1 m (Cabeza y cuerpo), 1,6 – 1,8 m (Cabeza y cuerpo)\r\nAltura: 1,2 m (Adulto, Al hombro), 90 – 110 cm (Adulto, Al hombro)', '1', '1', '2022-03-02 09:02:41', '2022-03-02 09:02:41'),
(3, 1, 'solo pdf', '¿Qué es un león y sus características?\r\nResultado de imagen para LEON QUE ES?\r\nEl león tiene cuerpo largo, piernas cortas, garras afiladas y cabeza grande. Los machos adultos miden entre 2,7 y 3 metros (9–10 pies) de largo, contando la cola. Tienen una alzada de cerca de 1 metro (3 pies) y pueden pesar entre 170 y 230 kilogramos (370–500 libras). Las hembras son más bajas y delgadas.\r\n\r\nleón | Britannica Escola', '0', '1', '2022-03-02 09:02:41', '2022-03-16 19:40:24');

