--
-- Estructura de tabla para la tabla `detalle_compra`
--

CREATE TABLE `detalle_compra` (
  `iddetalle_compra` int(11) NOT NULL,
  `idcompra_proyecto` int(11) NOT NULL,
  `idproducto` int(11) NOT NULL,
  `unidad_medida` varchar(15) COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `color` varchar(45) COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `ficha_tecnica_producto` varchar(65) COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `cantidad` decimal(11,2) DEFAULT NULL,
  `precio_sin_igv` decimal(11,4) DEFAULT NULL,
  `igv` decimal(11,4) DEFAULT NULL COMMENT 'precio_sin_igv * 0.18 = igv',
  `precio_con_igv` decimal(11,4) DEFAULT NULL COMMENT 'precio_sin_igv + igv = precio_con_igv',
  `descuento` decimal(11,2) DEFAULT NULL,
  `subtotal` decimal(11,2) DEFAULT NULL COMMENT 'precio_con_igv - descuento = subtotal',
  `estado` char(1) COLLATE utf8mb4_spanish_ci DEFAULT '1',
  `estado_delete` char(1) COLLATE utf8mb4_spanish_ci DEFAULT '1',
  `created_at` timestamp NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish_ci;

